import React from 'react'
import './Navbar.css'
import logo from '../Assets/shopvoid_logo.png'
import navprofileIcon from '../Assets/nav-profile.svg'

const Navbar = () => {
  return (
    <div className='navbar'>
      <img src={logo} alt="" />
      <img src={navprofileIcon} alt="" className="nav-logo"/>
    </div>
  )
}

export default Navbar
